  \"Multifunctional Shielding and Self-Healing HybridSil Smart Composites for Space
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\": 2\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T22:12:47.179574\",\n\t\"name\":
  \"multifunctional-shielding-and-self-healing-hybridsil-smart-composites-for-space-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NanoSonic has recently developed multifunctional
  shielding and self-healing HybridSil&amp;#63720; (HS) smart composites via the inclusion
  of innovative nanoshell inclusions.  These lightweight yet high-strength rapidly
  self-healing materials combined with NanoSonic's Metal Rubber&amp;#153; (MR) shielding
  nano-additives and are offered herein as protection systems for NASA vehicles, habitat
  modules, and pressure vessel structures.  The conductive aspect of Metal Rubber
  also enables damage detection.  This technology may overcome the current bottleneck
  of damage tolerance for current composites that form nearly undetectable cracks
  upon impact that impart drastic effects on the structural survivability.  HS-MR
  self-healing composites offer both self-healing and damage detection, as well as
  the added functionality of very high levels of electromagnetic shielding effectiveness
  (EMI SE) without the need for additional heavy layers.  MR exhibits EMI SE of greater
  than -100 dB upon exposure to a blow torch, repeated cold flexing at -50 ?C, and
  irradiation under a 60Co source.  During Phase I, TRL 5 shall be reached upon demonstration
  of damage tolerant, self-healing structural composites with assistance from our
  radiation expert STTR partner, CSU, and commercial space partner.  During Phase
  II, TRL 7 shall be achieved upon demonstrated damage detection and self-healing
  in a representative flight environment with our defense prime partner.\",\n\t\"license_title\":
